import {StyleSheet} from 'react-native';
export default StyleSheet.create({
  container: {
    paddingTop: 15,
    borderRadius: 10,
  },
  contentContainer: {
    padding: 15,
  },
  title: {
    padding: 15,
    paddingTop: 0,
    textAlign: 'left',
  },
});
